<section class=""section-features js--section-features"">
    <div class=""row"">
        <h2>Heading for that &mdash; section</h2>
        <p class=""long-copy"">
            Physical fitness is a state of health and well-being and, more specifically, the ability to perform aspects of sports, occupations and daily activities.
            Physical fitness is generally achieved through proper nutrition, moderate-vigorous physical exercise,and sufficient rest.

            Before the industrial revolution, fitnes");
            WriteLiteral(@"s was defined as the capacity to carry out the day’s activities without undue fatigue.
            However, with automation and changes in lifestyles physical fitness is now considered a measure of the body's ability to function
            efficiently and effectively in work and leisure activities, to be healthy, to resist hypokinetic diseases, and to meet emergency situations.
        </p>
    </div>

    <div class=""row"">
        <div class=""col span-1-of-4 box"">
            <i class=""ion-social-reddit icon-big""></i>
            <h3>First heading</h3>
            <p>
                A comprehensive fitness program tailored to an individual typically focuses on one or more specific skills, and on age or health-related needs such as bone health.
                Many sources also cite mental, social and emotional health as an important part of overall fitness.
            </p>
        </div>
        <div class=""col span-1-of-4 box"">
            <i class=""ion-heart icon-big""></i>
            <");
            WriteLiteral(@"h3>Second heading</h3>
            <p>
                Developing research has demonstrated that many of the benefits of exercise are mediated through the role of skeletal muscle as an endocrine organ.
                That is, contracting muscles release multiple substances known as myokines, which promote the growth of new tissue, tissue repair, and various anti-inflammatory functions.
            </p>
        </div>
        <div class=""col span-1-of-4 box"">
            <i class=""ion-clock icon-big""></i>
            <h3>Third heading</h3>
            <p>
                New (July 2011) guidelines in the United Kingdom include the following points: The intensity at which we exercise is key, and light activity such as strolling
                and housework is unlikely to have much positive impact on the health of most people.
            </p>
        </div>
        <div class=""col span-1-of-4 box"">
            <i class=""ion-social-usd icon-big""></i>
            <h3>Fourth heading</h3>
       ");
            WriteLiteral(@"     <p>
                Specific or task-oriented fitness is a person's ability to perform in a specific activity with a reasonable efficiency:
                for example, sports or military service. Specific training prepares athletes to perform well in their sport.
            </p>
        </div>
    </div>
</section>

